import React, { Fragment } from "react";

import s from "../../styles/sidebar.module.css";

const RightSideBar = () => {
  return (
    <Fragment>
      <div className={s.RightSideBarContainer}>
        <div className={s.Search}>
          <input type="text" placeholder="search"/>
        </div>
      </div>
    </Fragment>
  );
};

export default RightSideBar;
